import React from 'react';
import { Link } from 'react-router-dom';
import { NavbarSeaction , Logo ,logoText ,ulList ,listItem ,Achor} from './style.js';
import styled from 'styled-components';

export const LinkCss = Link`
    ${Achor}
`
const Navbar = () => {
	return (
		<NavbarSeaction>
			<div className="container">
				<Logo>
					<logoText>Ultra Profile</logoText>
				</Logo>

				<ulList>
					<listItem>
						<Link to="/">Home</Link>
					</listItem>
					<listItem>
						<Achor href="#">Work</Achor>
					</listItem>
					<listItem>
						<a href="#">Portfolio</a>
					</listItem>
					<listItem>
						<a href="#">Resume</a>
					</listItem>
					<listItem>
						<a href="#">About</a>
					</listItem>
					<listItem>
						<Link to="/Contact">Contact</Link>
					</listItem>
				</ulList>
			</div>
		</NavbarSeaction>
	);
};
export default Navbar;
